import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router} from "react-router-dom";
import {Context} from "./Context"
import App from './App'; 



ReactDOM.render(
  <Router>
    <Context>
      <App />
    </Context>
  </Router>
  ,document.getElementById('root')
);
